import React, {useEffect} from 'react'
import axois from 'axios'

function Books() {
    useEffect(
        fetch("http://localhost:5000/").
        then(res =>{
            const data = res.data;
            console.log(data);
        }).catch(err=>{
            console.log(err);
        })
    )
    return (
        <div>
            <h1>Hi</h1>
        </div>
    )
}

export default Books
